"     <li>",
"      Flunavert (DE);",
"     </li>",
"     <li>",
"      Fluzina (CR, DO, EC, GT, HN, NI, PA, SV);",
"     </li>",
"     <li>",
"      Forknow (MY, SG);",
"     </li>",
"     <li>",
"      Frego (ID);",
"     </li>",
"     <li>",
"      Galium (ID);",
"     </li>",
"     <li>",
"      Gradient (IT);",
"     </li>",
"     <li>",
"      Headache (KP);",
"     </li>",
"     <li>",
"      Irrigor (CN);",
"     </li>",
"     <li>",
"      Liberal (TH);",
"     </li>",
"     <li>",
"      Lunar (PK);",
"     </li>",
"     <li>",
"      MGR (IN);",
"     </li>",
"     <li>",
"      Migon (IN);",
"     </li>",
"     <li>",
"      Natil-N (DE);",
"     </li>",
"     <li>",
"      Poli-Flunarin (SG);",
"     </li>",
"     <li>",
"      Seremig (ID);",
"     </li>",
"     <li>",
"      Sibelium (AR, AT, BE, BG, BR, CH, CL, CN, CO, CZ, DK, ES, FR, GR, ID, IE, IN, IT, KP, MX, NL, PH, PK, PT, PY, TH, TR, UY, VE, ZA);",
"     </li>",
"     <li>",
"      Sinral (ID);",
"     </li>",
"     <li>",
"      Suzin (TW);",
"     </li>",
"     <li>",
"      Vanid (TH);",
"     </li>",
"     <li>",
"      Xepalium (ID);",
"     </li>",
"     <li>",
"      Zinasen (PE)",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block pha drugH1Div\" id=\"F3950263\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Flunarizine is a selective calcium channel blocker that prevents cellular calcium overload by reducing transmembrane calcium influx; also has antihistamine properties. Has greater effect on decreasing the frequency of migraine attacks than on decreasing the severity or duration of attacks.",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F3950265\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Absorption: Well absorbed",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Distribution: V",
"     <sub>",
"      d",
"     </sub>",
"     : Mean: 43.2 L/kg",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Protein binding: 99%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Metabolism: Hepatic: N-oxidation, aromatic hydroxylation",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Half-life elimination: ~19 days",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Time to peak, plasma: 2-4 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Excretion: Feces (&lt;6%); urine (minimal)",
"    </p>",
"   </div>",
"  </div>",
