"   <div class=\"block pha drugH1Div\" id=\"F161239\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Promotes active immunity to diphtheria, tetanus, and pertussis by inducing production of specific antibodies.",
"    </p>",
"   </div>",
"  </div>",
