var title_f33_43_34491="Medical treatment of chronic constipation in children";
var content_f33_43_34491=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F61175&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F61175&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Suggested regimen for recurrent or chronic constipation when a change in diet is not effective or is impossible to achieve",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_left\">",
"        Step 1",
"       </td>",
"       <td>",
"        Start 2 to 4 teaspoons (3.5 teaspoons = 17 gm) of PEG without electrolytes (Miralax&reg;) once daily (or appropriate dose of other laxative).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_left\">",
"        Step 2",
"       </td>",
"       <td>",
"        Increase or decrease by 1 to 2 teaspoons every 2 to 3 days until the desired result of daily soft stools is achieved.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_left\">",
"        Step 3",
"       </td>",
"       <td>",
"        Follow-up by phone or a return visit within 1 month to be sure the laxative is effective.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_left\">",
"        Step 4",
"       </td>",
"       <td>",
"        Continue to work on adding fiber and extra liquids to the diet each day.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_left\">",
"        Step 5",
"       </td>",
"       <td>",
"        After 6 to 8 weeks of soft daily bowel movements, begin to taper the laxative dose by 1/2 to 1 teaspoon every 2 weeks, until daily movements continue without the need for a laxative.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_left\">",
"        Step 6",
"       </td>",
"       <td>",
"        If stools become hard once again, increase the dose slightly and retry weaning off the laxative in another 6 to 8 weeks.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_left\">",
"        Step 7",
"       </td>",
"       <td>",
"        This process may take from 2 to 4 weeks to six months, but the end result should be resolution of the constipation.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     PEG: polyethylene glycol",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
